import React, { useEffect, useState } from "react";
import { retailerAPI, cartAPI } from "../services/api";
import { useParams, useNavigate } from "react-router-dom";
import "./RetailerFarmersProducts.css";

const RetailerFarmerProducts = () => {
  const { farmerId } = useParams();
  const navigate = useNavigate();

  const retailer = JSON.parse(localStorage.getItem("retailer"));
  const retailerId = retailer?.id;

  const [farmer, setFarmer] = useState(null);
  const [products, setProducts] = useState([]);

  // Load farmer + products
  useEffect(() => {
    if (!retailerId) {
      alert("Please log in as retailer");
      navigate("/retailer/login");
      return;
    }

    loadFarmer(farmerId);
  }, [farmerId, navigate, retailerId]);

  const loadFarmer = async (id) => {
    try {
      const res = await retailerAPI.getFarmerById(id);
      setFarmer(res.data);
      setProducts(res.data.products || []);
    } catch (error) {
      console.error("Error loading farmer products:", error);
    }
  };

  // Add product to cart
  const addToCart = async (productId) => {
    try {
      await cartAPI.addToCart(retailerId, productId, 1);
      alert("‚úî Product added to cart!");
      navigate("/retailer/cart");
    } catch (err) {
      console.error("Failed to add to cart:", err);
      alert("‚ùå Failed to add product");
    }
  };

  return (
    <div className="farmer-products-page">

      <div className="header-bar">
        <button className="back-btn" onClick={() => navigate("/retailer/dashboard")}>
          ‚Üê Back
        </button>

        <h2>üßë‚Äçüåæ Farmer Products</h2>

        <button className="cart-btn" onClick={() => navigate("/retailer/cart")}>
          üõí Cart
        </button>
      </div>

      {!farmer ? (
        <p className="loading">Loading farmer...</p>
      ) : (
        <>
          <div className="farmer-info">
            <h3>{farmer.name}</h3>
            <p><b>üìû Phone:</b> {farmer.phone}</p>
            <p><b>üìç Address:</b> {farmer.address}</p>
            <p><b>üß∫ Total Products:</b> {products.length}</p>
          </div>

          {products.length === 0 ? (
            <p>No products available for this farmer.</p>
          ) : (
            <table className="product-table">
              <thead>
                <tr>
                  <th>Image</th>
                  <th>Name</th>
                  <th>Category</th>
                  <th>Price (‚Çπ)</th>
                  <th>Stock</th>
                  <th>Add</th>
                </tr>
              </thead>

              <tbody>
                {products.map((p) => (
                  <tr key={p.id}>
                    <td>
                      <img
                        src={`http://localhost:8080/uploads/${p.image}`}
                        alt={p.name}
                        className="product-img"
                      />
                    </td>

                    <td>{p.name}</td>
                    <td>{p.category}</td>
                    <td>‚Çπ{p.price}</td>
                    <td>{p.stock}</td>

                    <td>
                      <button
                        className="add-btn"
                        onClick={() => addToCart(p.id)}
                      >
                        ‚ûï Add
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </>
      )}
    </div>
  );
};

export default RetailerFarmerProducts;
